document.addEventListener("DOMContentLoaded",()=>{const t=document.querySelectorAll('[class*="width-"]');t.forEach(t=>{const o=t.className.split(" ");o.forEach(o=>{if(o.startsWith("width-")){const e=o.split("-");t.style.width=e.pop()+"%"}})});let o=document.querySelectorAll(".ranking-color");o.forEach(function(t){let o=window.getComputedStyle(t,null).getPropertyValue("background-color");console.log(o)})});